  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  has been prepared for Ohio River Islands National Wildlife Refuge. The CCP is a
  management tool to be used by the Refuge staff. It will help guide management decisions
  over the next 15 years, and set forth strategies for achieving Refuge goals and
  objectives within that timeframe. Overriding considerations reflected in the plan
  are that fish and wildlife conservation requires first priority in refuge management,
  and that wildlife-dependent recreation is allowed and encouraged as long as it is
  compatible with, or does not detract from, the mission of the National Wildlife
  Refuge System or purposes of the Refuge.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
